INSERT INTO `material` VALUES ('1598515711346sTvDiEgj3Td5VcypFgk', '6a4b1e7e98d854d88e3a964db02a348e', '98', '98', '2020-08-27 08:08:31', '宋品当支书快二十年了，一只腿长一只腿短，不过并不严重，没有几个人注意到，但我是清楚的，因为他、麦香和宋庄周遭许许多多的人都是我接生的，他出生我便发现了fdefwfew', '/3/usr/localServerData/jieou/material/1598515711346sTvDiEgj3Td5VcypFgk/source6a4b1e7e98d854d88e3a964db02a348e.jpg?Expires=2244870826&OSSAccessKeyId=LTAI4G5AwbSznF21ibjf4gFf&Signature=461c2I1HOnfl2x0ZbC7qKBJCiHU%3D', '23.2996', 'icon6a4b1e7e98d854d88e3a964db02a348el.jpg', 'source6a4b1e7e98d854d88e3a964db02a348e.jpg', '飞翔', '142', '/usr/localServerData/jieou/material//1598515711346sTvDiEgj3Td5VcypFgk/source6a4b1e7e98d854d88e3a964db02a348e.jpg', 'model', '/3/usr/localServerData/jieou/material/1598515711346sTvDiEgj3Td5VcypFgk/icon6a4b1e7e98d854d88e3a964db02a348el.jpg?Expires=2244870826&OSSAccessKeyId=LTAI4G5AwbSznF21ibjf4gFf&Signature=HfaJ%2FTUf%2BlcGdWfN7jYGNo%2B6E58%3D', '5', '0', '2', '0', null, '1', '/var/www/html/Thumbnail/base/ttt/1634813940265source6a4b1e7e98d854d88e3a964db02a348e.jpg');
INSERT INTO `material` VALUES ('1598595469333Ems1x4IWhpwrGmsvqbw', 'b8fae750f72cdb2bc41ba5b734b89296', '98', '98', '2020-08-28 06:17:49', '那次喝了半斤酒——事后他是这样讲的，但据fewf别人说他至少喝了一斤，开四轮车从县城返回，车上坐着他的妻子王大翠，小姨子王小翠，离村还有两三里左右，车翻进沟里', '/3/usr/localServerData/jieou/material/1598595469333Ems1x4IWhpwrGmsvqbw/sourceb8fae750f72cdb2bc41ba5b734b89296.jpg?Expires=2244870826&OSSAccessKeyId=LTAI4G5AwbSznF21ibjf4gFf&Signature=s4xiwVRfXyQYXQhLqAkVttUg5WU%3D', '1.841142', '1661492646443.jpg', 'sourceb8fae750f72cdb2bc41ba5b734b89296.jpg', 'iui', '142', '/usr/localServerData/jieou/material//1598595469333Ems1x4IWhpwrGmsvqbw/sourceb8fae750f72cdb2bc41ba5b734b89296.jpg', 'pano', '/3/usr/localServerData/jieou/material/1598595469333Ems1x4IWhpwrGmsvqbw/1661492646443.jpg?Expires=2292212646&OSSAccessKeyId=LTAI4G5AwbSznF21ibjf4gFf&Signature=u4P7Gi8h7OHFQiVl2R1JCAtfZ2w%3D', '4', '0', '2', '0', null, null, '/var/www/html/Thumbnail/base/ttt/1634813940431sourceb8fae750f72cdb2bc41ba5b734b89296.jpg');
